// Career.jsx
import React from "react";
import BoxStyle from "../components/Careers/CareerBox";

const Career = () => {
  const jobOpening = {
    company:"Example Company",
    position:  "Software Engineer",
    location: "New York",
    description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit...", // Your job description here
  }

  return (
    <div className="text-black font-equinox-sans bg-[#d6d4d4] bg-cover">
      <BoxStyle jobOpening={jobOpening}/>
    </div>
  );
};

export default Career;
